import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams,
    useRouteMatch
} from "react-router-dom";
import './App.css';
import axios from "axios";
import { Redirect } from 'react-router-dom'
import Cookies from 'universal-cookie';

class App extends Component {

    render() {
        return (
            <div className="App">
                <Router>
                    <div>
                        <ul>
                            <li>
                                <Link to="/">Home</Link>
                            </li>
                            <li>
                                <Link to="/login">Login</Link>
                            </li>
                            <li>
                                <Link to="/register">Register</Link>
                            </li>
                            <li>
                                <Link to="/profil">Profil</Link>
                            </li>
                        </ul>

                        <hr />

                        <Switch>
                            <Route exact path="/">
                                <Home />
                            </Route>
                            <Route path="/login">
                            </Route>
                            <Route path="/register">
                            </Route>
                            <Route path="/profil">
                            </Route>
                        </Switch>
                    </div>
                </Router>
            </div>
        );
    }
}

class Home extends Component{

    constructor(props) {
        super(props);
        this.state = {
            isSignedUp: false,
            Name: '',
        }
    }
    cookies = new Cookies();

    handleClick = (event) => {

        if (this.state.name === '') {
            const enteredName = prompt('Please enter your name')
            this.setState({ Name : enteredName })
        }
    }

    render() {
        return (
            <div>
                <h2>Home</h2>
            </div>
        )
    }
}

export default App;
